  input: 'TEXT,3XA,FEC-187186,"Our Best Efforts Procedures are as follows:    1. The
    original solicitation contains the following message: State and Federal law requires
    us to use our best effort to collect and report the name, mailing address, employer,
    occupation and employer''s address of individuals who make contributions to the
    WSDCC in excess of $100 and $200 respectively per calendar year.  However, the
    statement is printed in smaller type than the rest of the solicitation which is
    not in compliance with the rules for clear and conspicuous.    2. If the information
    is not provided, a second request is made to contributors, whose contributions
    for the year exceed $200, in a letter prepared and mailed on the 1st of each month.  The
    letter reads as follows: Thank you for your contribution to the Washington State
    Democratic Party.  We greatly appreciate your support.  Federal law requires us
    to use our best efforts to collect and report the name, mailing address, occupation,
    and the name of employer of individuals whose contributios exceed $200 in a calendar
    year.  Please call our office at your ealiest convenience and provide this information
    at 206-583-0664 or by email: greg@wa-democrats.org.  You can also fill in the
    form below and return it in the envelop provided for your convenience.  No additional
    solicittion is made and a pre-addressed return envelope is provided.    3.  We
    have received one response to the letters sent, a response to the September 1st
    letter received on September 7th.  However, we failed to file an amended Schedule
    A or an amended report on or before the next reporting date which would have been
    September 20th.  We will be amending reports May through August for a late software
    update which causes the itemized and unitemized totals to change if contributor
    records are merged after the update.    Schedule A, Line 11(c), Other Political
    Committees: Contribution from Piper Rudnick LLP - PAC was added to the name to
